function generateDigest(params, key) {
    // Convert the JSON object to a string
    const jsonString = JSON.stringify(params);

    // Append the private key
    const combined = jsonString + key;

    // Compute MD5, then encode to Base64
    const md5Hash = crypto.createHash('md5').update(combined).digest();
    return md5Hash.toString('base64');
}

