function getConnectedAgentsData(channel, webhookData) {
    const { agents } = webhookData;
    const result = [];

    for (const agentName in agents) {
        const agent = agents[agentName];

        // Перевіряємо, чи канал підключений до агента
        if (agent.channels.includes(channel)) {
            const integration = agent.integration ? webhookData[agent.integration] : null;
            const keys = integration
                ? Object.keys(integration).reduce((acc, key) => {
                    if (typeof integration[key] === "string") {
                        acc[key] = integration[key];
                    }
                    return acc;
                }, {})
                : {};

            result.push({
                agentType: agentName,
                productBaseId: agent.productBaseId || null,
                integrationType: agent.integration || null,
                integrationKeys: keys,
