async function deleteVectorsBySource(msg) {
    try {
        const { ChromaClient } = chromadb;
        const client = new ChromaClient({ path: env.get('VECTORDB-CHROMA-HOST-NAME') });

        if (!msg.old || !msg.old.name) {
            throw new Error('msg.old.name is not defined');
        }

        const collection = await client.getCollection({ name: msg.old.name });

        const queryResult = await collection.get({
            where: { "source": { "$eq": msg.payload[0].source } },
        });

        node.warn(`Query result for source "${msg.payload[0].source}": ${JSON.stringify(queryResult)}`);

        const vectorIds = queryResult.ids?.flat() || [];
        if (vectorIds.length === 0) {
            node.warn(`No vectors found for source "${msg.payload[0].source}". Nothing to delete.`);
            return msg;
        }

        node.warn(`Found ${vectorIds.length} vectors to delete with IDs: ${JSON.stringify(vectorIds)}`);

        const deleteResult = await collection.delete({ ids: vectorIds });

        node.warn(`Deletion result: ${JSON.stringify(deleteResult)}`);

        msg.payload = {
            status: "success",
            deletedCount: vectorIds.length,
            deletedIds: vectorIds,
        };
        return msg;
    } catch (error) {
        node.warn(`Error during vector deletion: ${error.message}`);
        msg.payload = { status: "error", error: error.message };
        return msg;
    }
}

